func printBoard(board [][]byte) {
	for i := range board {
		for j := range board[i] {
			fmt.Printf(" %s", string(board[i][j]))
		}
		fmt.Printf("\n")
	}
	fmt.Printf("\n")
}

type pixel struct {
	x int
	y int
}

type cache struct {
	cache map[int]bool
}

func newCache() cache {
	c := make(map[int]bool)
	return cache{cache: c}
}

func solve(board [][]byte) {
	if board == nil {
		return
	}
	if len(board) == 0 {
		return
	}
	if len(board[0]) == 0 {
		return
	}
	h := len(board)
	w := len(board[0])
	c := newCache()
	toFlip := make([]pixel, 0)
	for y := 0; y < h; y++ {
		for x := 0; x < w; x++ {
			visited := make([]bool, w*h)
			if board[y][x] == 'O' && !c.isConnectedCached(x, y, board, visited) {
				fmt.Println("x", x, "y", y, string(board[y][x]), c.isConnectedCached(x, y, board, visited))
				toFlip = append(toFlip, pixel{x: x, y: y})
			}
		}
	}
	fmt.Println(toFlip)
	for _, p := range toFlip {
		board[p.y][p.x] = 'X'
	}
}

func (c *cache) isConnectedCached(x0, y0 int, b [][]byte, visited []bool) bool {
	w := len(b[0])
	v, f := c.cache[w*y0+x0]
	if f {
		fmt.Println("cache x0:", x0, "y0:", y0, v)
		return v
	}
	ret := c.isConnected(x0, y0, b, visited)
	c.cache[w*y0+x0] = ret
	return ret
}

func (c *cache) isConnected(x0, y0 int, b [][]byte, visited []bool) bool {
	h := len(b)
	w := len(b[0])
	visited[w*y0+x0] = true
	if b[y0][x0] == 'X' {
		return false
	}
	if x0 == 0 || x0 == w-1 || y0 == 0 || y0 == h-1 {
		return true
	}
	if visited[w*(y0-1)+x0] == false && c.isConnectedCached(x0, y0-1, b, visited) {
		return true
	}
	if visited[w*(y0+1)+x0] == false && c.isConnectedCached(x0, y0+1, b, visited) {
		return true
	}
	if visited[w*y0+x0-1] == false && c.isConnectedCached(x0-1, y0, b, visited) {
		return true
	}
	if visited[w*y0+x0+1] == false && c.isConnectedCached(x0+1, y0, b, visited) {
		return true
	}
	return false
}
